import React, {useState} from 'react';

const Form=()=>{

    let [NewName,update]=useState();
    let [FullName,update1]=useState();
    

    const Input=(event)=>{
        console.log(event.target.value)
        update(event.target.value);
            
        }
    const showName=(event)=>{
        let new1=update(event.target.value);
        update1(new1);
    }
    return (
        <>
        <label htmlFor="">Hello {FullName}</label> <br />
        <input type="text" onChange={Input} Value={NewName} placeholder='Enter Your Name'/><br />
        <button type='submit' onClick={showName}>Submit</button>
        </>
    )
}

export default Form;
